// @author         screach
// @name           R8 Marker
// @category       Wasabee
// @version        0.0.2
// @description    Marks Enlightened portals where you can put your L8 resonator with Wasabee "upgrade" marker

const r8finder = (window.plugin.r8finder = {});

r8finder.MARKER_TYPE = 'UpgradePortalAlert';
r8finder.MAX_R8_COUNT = 1;
r8finder.MIN_PORTAL_LEVEL = 7; // min portal level to check
r8finder.MISSING_TO_P8 = 7; // R8 missing to P8

r8finder.portalsRaw = [];
r8finder.addedPortals = 0;

function handlePortalDetails(guid, pd) {
  var r8 = pd.resonators.filter((r) => r && r.level === 8);
  var playerR8 = r8.filter((r) => r && r.owner === PLAYER.nickname);

  if (playerR8.length < r8finder.MAX_R8_COUNT && 8 - (r8.length - playerR8.length + r8finder.MAX_R8_COUNT) <= r8finder.MISSING_TO_P8) {
    console.log(pd);
    var rawPortal = {
      id: guid,
      lat: (pd.latE6 / 1e6).toFixed(6),
      lng: (pd.lngE6 / 1e6).toFixed(6),
      name: pd.title,
      comment: '',
      hardness: '',
    };

    r8finder.portalsRaw.push(rawPortal);
  }
}

function finishResults() {
  window.plugin.wasabee._selectedOp.convertPortalsToObjs(r8finder.portalsRaw).forEach((p) => addMarker(p, r8finder.MARKER_TYPE));
  window.plugin.wasabee._selectedOp.update(r8finder.addedPortals > 0);

  alert('Checked ' + Object.keys(window.portals).length + ' Portals<br>' + '<br>Found ' + r8finder.addedPortals + ' with missing YOUR R8');
}

function addMarker(p, markerType) {
  if (!window.plugin.wasabee._selectedOp.containsMarker(p, markerType)) {
    r8finder.addedPortals++;
    console.log(p);
    window.plugin.wasabee._selectedOp.addPortal(p);
    window.plugin.wasabee._selectedOp.addMarker(markerType, p);
  }
}

function resetFoundPortals() {
  r8finder.portalsRaw = [];
  r8finder.addedPortals = 0;
}

function doSearchResonators() {
  resetFoundPortals();

  var requests = [];
  Object.keys(window.portals).forEach((guid) => {
    var portal = window.portals[guid].options;
    if (PLAYER.team.startsWith(portal.data.team) && portal.level >= r8finder.MIN_PORTAL_LEVEL) {
      if (portalDetail.isFresh(guid)) {
        handlePortalDetails(guid, portalDetail.get(guid));
      } else {
        var request = portalDetail
          .request(guid)
          .then((pd) => handlePortalDetails(guid, pd))
          .catch((e) => {
            console.log('Error loading portal detail: ' + e);
          });
        requests.push(request);
      }
    }
  });
  return Promise.all(requests).finally(finishResults);
}

function done() {
  r8finder.running = false;
  r8finder.searchButton.classList.remove('working');
}

r8finder.searchResonators = function () {
  if (!r8finder.running) {
    r8finder.running = true;
    r8finder.searchButton.classList.add('working');
    let promise;
    try {
      promise = doSearchResonators();
    } finally {
      if (promise) {
        promise.finally(() => {
          done();
        });
      } else {
        done();
      }
    }
  }
};

